import styled, {css} from 'styled-components'

export const StyledButton = styled.button`
    ${({login}) => login &&
    css`
        background: #9DD1F1; 
        width: 302px; 
        height: 60px; 
        border: none; 
        color: white; 
        font-size: 24px; 
        font-weight: 800; 
        border-radius: 4px; 
        
        :hover{
            background: #89c9f1; 
        }
    `}
    

`
